func (c *current) onField1(primaryKey, name, fieldType any) (any, error) {
	// Validation : interdire l'utilisation de _id_ comme nom de champ
	nameStr := name.(string)
	if nameStr == "_id_" {
		return nil, fmt.Errorf("le champ '_id_' est rserv au systme et ne peut pas tre utilis")
	}

	result := map[string]interface{}{
		"name":         name,
		"type":         fieldType,
		"isPrimaryKey": false,
	}

	if primaryKey != nil {
		result["isPrimaryKey"] = true
	}

	return result, nil
}

