func (c *current) onDuration1(value, unit any) (any, error) {
	val := value.(int)
	unitStr := unit.(string)

	if val <= 0 {
		return nil, fmt.Errorf("duration must be positive, got %d", val)
	}

	const (
		SecondsPerMinute = 60
		SecondsPerHour   = 3600
		SecondsPerDay    = 86400
	)

	var seconds int
	switch unitStr {
	case "s":
		seconds = val
	case "m":
		seconds = val * SecondsPerMinute
	case "h":
		seconds = val * SecondsPerHour
	case "d":
		seconds = val * SecondsPerDay
	default:
		return nil, fmt.Errorf("invalid time unit '%s', expected s, m, h or d", unitStr)
	}

	return seconds, nil
}

